// 
function getQinglongTime() {
    const now = new Date();
    const year = now.getFullYear();
    const month = String(now.getMonth() + 1).padStart(2, '0');
    const day = String(now.getDate()).padStart(2, '0');
    const hours = String(now.getHours()).padStart(2, '0');
    const minutes = String(now.getMinutes()).padStart(2, '0');
    const seconds = String(now.getSeconds()).padStart(2, '0');
    return `${year}-${month}-${day} ${hours}:${minutes}:${seconds}`;
}
// 
async function getNetworkBeijingTime() {
    return new Promise((resolve) => {
        const options = {
            hostname: 'timeapi.io',
            path: '/api/Time/current/zone?timeZone=Asia/Shanghai',
            method: 'GET',
            timeout: 3000
        };
        const req = http.request(options, (res) => {
            let data = '';
            res.on('data', (chunk) => data += chunk);
            res.on('end', () => {
                try {
                    const timeData = JSON.parse(data);
                    const dateTime = timeData.dateTime;
                    resolve(dateTime.replace('T', ' ').split('.')[0]);
                } catch (error) {
                    resolve(getQinglongTime());
                }
            });
        });
        req.on('error', () => resolve(getQinglongTime()));
        req.on('timeout', () => {
            req.destroy();
            resolve(getQinglongTime());
        });
        req.end();
    });
}
// 
async function getCurrentBeijingTime() {
    try {
        return await getNetworkBeijingTime();
    } catch (error) {
        return getQinglongTime();
    }
}
// 
async function calculateRemainingTime(expireTime) {
    const currentTimeStr = await getCurrentBeijingTime();
    const now = new Date(currentTimeStr);
    const expire = new Date(expireTime);
    const remainingMs = expire - now;
    
    if (remainingMs <= 0) {
        return { 
            expired: true, 
            remaining: 0,
            days: 0, hours: 0, minutes: 0, seconds: 0,
            formatted: "0000"
        };
    }
    
    const remainingDays = Math.floor(remainingMs / (24 * 60 * 60 * 1000));
    const remainingHours = Math.floor((remainingMs % (24 * 60 * 60 * 1000)) / (60 * 60 * 1000));
    const remainingMinutes = Math.floor((remainingMs % (60 * 60 * 1000)) / (60 * 1000));
    const remainingSeconds = Math.floor((remainingMs % (60 * 1000)) / 1000);
    
    return {
        expired: false,
        remaining: remainingMs,
        days: remainingDays,
        hours: remainingHours,
        minutes: remainingMinutes,
        seconds: remainingSeconds,
        formatted: `${remainingDays}${remainingHours}${remainingMinutes}${remainingSeconds}`
    };
}
// 24
function formatTime(date) {
    const year = date.getFullYear();
    const month = String(date.getMonth() + 1).padStart(2, '0');
    const day = String(date.getDate()).padStart(2, '0');
    const hours = String(date.getHours()).padStart(2, '0');
    const minutes = String(date.getMinutes()).padStart(2, '0');
    const seconds = String(date.getSeconds()).padStart(2, '0');
    return `${year}-${month}-${day} ${hours}:${minutes}:${seconds}`;
}
async function checkKeyValidity(userKeyData, userKey) {
    const currentTimeStr = await getCurrentBeijingTime();
    const now = new Date(currentTimeStr);
    const createTime = new Date(userKeyData.createTime);
    const expireTime = new Date(userKeyData.expireTime);
    
    if (now > expireTime) {
        return { 
            valid: false, 
            reason: '',
            createTime: formatTime(createTime),
            expireTime: formatTime(expireTime),
            currentTime: currentTimeStr
        };
    }
    
    if (now < createTime) {
        return { 
            valid: false, 
            reason: '',
            createTime: formatTime(createTime),
            expireTime: formatTime(expireTime),
            currentTime: currentTimeStr
        };
    }
    
    const remainingTime = await calculateRemainingTime(userKeyData.expireTime);
    
    return { 
        valid: true, 
        createTime: formatTime(createTime),
        expireTime: formatTime(expireTime),
        currentTime: currentTimeStr,
        remainingTime: remainingTime
    };
}
