function countdown(seconds, callback) {
    console.log(' :');
    function tick(remaining) {
        if (remaining > 0) {
            console.log(`    ${remaining}`);
            setTimeout(() => tick(remaining - 1), 1000);
        } else {
            console.log('    ...');
            setTimeout(callback, 500);
        }
    }
    tick(seconds);
}
